import React from 'react';
import Purse from './images/purse-bags-removebg-preview.png';

function Quick(){
    return(
        <div style={{height: '100vh'}}>
            <div style={{borderRight: '1px solid #999393',borderBottom: '1px solid #999393', height: '30vh', width: '20vw'}}>
                <div>
                    <img src={Purse} style={{height: '5vh', width: '5vw', marginLeft: '-8vw', marginRight: '3vw', backgroundColor: 'transparent'}} />
                    <span style={{color: '#2c2370'}}>Purse</span>
                </div>
                <div>
                    <img src={require('./images/wallet.jpg')} style={{height: '5vh', width: '5vw', marginLeft: '-8vw', marginRight: '3vw', backgroundColor: 'transparent'}} />
                    <span style={{color: '#2c2370'}}>wallet</span>
                </div>
            </div>
            
                
            
        </div>
    )
}

export default Quick;
